	private static void getData(List<String> headStrings,
			List<List<String>> contentStrings, String ObjectString,
			String dataName, String subOBString) {
		JSONObject job = JSON.parseObject(ObjectString);
		JSONArray models = job.getJSONArray("models");
		JSONObject model = models.getJSONObject(0);
		JSONObject output = (JSONObject) model.get("output");

		JSONObject dataNameOB = (JSONObject) output.get(dataName);
		if (dataNameOB == null) {
			return;
		}
		if(subOBString != null){
			dataNameOB = (JSONObject) dataNameOB.get(subOBString);
		}

		JSONArray sh_columns = (JSONArray) dataNameOB.get("columns");
		if (sh_columns == null) {
			return;
		}
		for (int i = 0; i < sh_columns.size(); i++) {
			JSONObject name = sh_columns.getJSONObject(i);
			headStrings.add(name.get("name") + "");
		}

		JSONArray data = (JSONArray) dataNameOB.get("data");
		JSONArray sub_data = (JSONArray) data.get(0);
		for (int j = 0; j < sub_data.size(); j++) {
			List<String> line = new ArrayList<String>();
			for (int i = 0; i < data.size(); i++) {
				JSONArray d = (JSONArray) data.get(i);
				line.add(d.getString(j));
			}
			contentStrings.add(line);
		}
	}

	private static void printData(List<String> headStrings,
			List<List<String>> contentStrings) {
		for (String strs : headStrings) {
			System.out.print(strs + "\t");
		}
		System.out.println();

		for (int i = 0; i < contentStrings.size(); i++) {
			if(i == 10){
				return;
			}
			List<String> strs = contentStrings.get(i);
			for (int j = 0; j < strs.size(); j++) {
				System.out.print(strs.get(j) + "\t");
			}
			System.out.println();
		}
	}

